import React from "react";
import Header from "./components/Header";
import CreateNotes from "./components/CreateNotes";
import Note from "./components/Note";


const App = () => {
    const [note, setNote] = useState({
        title: '',
        content: ''
    });
    return (
        <>
            <Header />
            <CreateNotes />
            <div className="note-box">
                <Note/>
            </div>
        </>
    );
};

export default App;
